import React from 'react'
import axios from 'axios';
const Mid = () => {

    const options = {
        method: 'GET',
        url: 'https://airbnb13.p.rapidapi.com/autocomplete',
        params: {query: 'paris'},
        headers: {
          'X-RapidAPI-Key': 'c0ae563f37mshd4b90cc967d0f2bp1071f8jsnae849873a031',
          'X-RapidAPI-Host': 'airbnb13.p.rapidapi.com'
        }
      };
      
      try {
          const response =  axios.request(options);
          console.log(response.data);
      } catch (error) {
          console.error(error);
      }


  return (
    <div>
        <div>Inspiration for future getaways</div>
        <div style={{display:"flex",gap:"30px"}}>
            <div>Popular</div>
            <div>Art&Culture</div>
            <div>Outdoors</div>
            <div>Mountains</div>
            <div>Beach</div>
            <div>Unique Stays</div>
            <div>Catagories</div>
            <div>Thing To Do</div>
        </div>
        <div></div>
    </div>
  )
}

export default Mid
